import React from "react";

function Page(props) {
    let listPages = [];
    if (props.pages && props.pages.length > 0) {
        const pages = props.pages;

        const addAllItems = pages => {
          pages.forEach(page => {
            const pageToAdd = <li key={page.id}>{page.name}</li>
            listPages.push(pageToAdd);
            if (page.hasOwnProperty("children")) {
              addAllItems(page.children);
            }
          });
        }

        addAllItems(pages);
    }

    return (
        <ul>{listPages}</ul>
    )
}

export default Page;
